"   <div class=\"ex_sect_xr thclist drugH1Div drugBrandNames\" id=\"F219803\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Pharmacologic Category",
"    </span>",
"    <ul>",
"     <li>",
"      Acne Products;",
"     </li>",
"     <li>",
"      Keratolytic Agent;",
"     </li>",
"     <li>",
"      Topical Skin Product, Acne",
"     </li>",
"    </ul>",
"   </div>",
"   <div class=\"block doa drugH1Div\" id=\"F219775\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Dosing: Adult",
"    </span>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     <b>",
"      Acne: Topical:",
"     </b>",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:4em;text-align:justify;\">",
"     <i>",
"      Cream, cloth, foam, or liquid cleansers (2%):",
"     </i>",
"     Use to cleanse skin once or twice daily. Massage gently into skin, work into lather and rinse thoroughly. Cloths should be wet with water prior to using and disposed of (not flushed) after use.",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:4em;text-align:justify;\">",
"     <i>",
"      Gel (0.5% or 2%):",
"     </i>",
"     Apply small amount to face in the morning or evening; if peeling occurs, may be used every other day. Some products may be labeled for OTC use up to 3 or 4 times per day. Apply to clean, dry skin",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:4em;text-align:justify;\">",
"     <i>",
"      Pads (0.5% or 2%):",
"     </i>",
"     Use pad to cover affected area with thin layer of salicylic acid 1-3 times/day. Apply to clean, dry skin. Do not leave pad on skin.",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:4em;text-align:justify;\">",
"     <i>",
"      Patch (2%):",
"     </i>",
"     At bedtime, after washing face, allow skin to dry at least 5 minutes. Apply patch directly over pimple being treated. Remove in the morning.",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:4em;text-align:justify;\">",
"     <i>",
"      Shower/bath gels or soap (2%):",
"     </i>",
"     Use once daily in shower or bath to massage over skin prone to acne. Rinse well.",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     <b>",
"      Callus, corns, or warts: Topical:",
"     </b>",
"     <b>",
"      Note:",
"     </b>",
"     For warts: Before applying product, soak area in warm water for 5 minutes; remove loosened wart tissue with a brush, wash cloth, or emery board; dry area thoroughly, then apply medication.",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:4em;text-align:justify;\">",
"     <i>",
"      Foam:",
"     </i>",
"     Apply to affected area twice daily; rub into skin until completely absorbed.",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:4em;text-align:justify;\">",
"     <i>",
"      Gel or liquid (17%):",
"     </i>",
"     Apply to each wart and allow to dry. May repeat once or twice daily, up to 12 weeks. Apply to clean dry area.",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:4em;text-align:justify;\">",
"     <i>",
"      Gel (6%):",
"     </i>",
"     Apply to affected area once daily, generally used at night and rinsed off in the morning.",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:4em;text-align:justify;\">",
"     <i>",
"      Liquid (27.5%):",
"     </i>",
"     Apply to each wart; allow to dry then apply a second application. May repeat two-application process once or twice daily, up to 6 weeks",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:4em;text-align:justify;\">",
"     <i>",
"      Transdermal patch (15%):",
"     </i>",
"     Apply directly over affected area at bedtime, leave in place overnight and remove in the morning. Patch should be trimmed to cover affected area. May repeat daily for up to 12 weeks.",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:4em;text-align:justify;\">",
"     <i>",
"      Transdermal patch (40%):",
"     </i>",
"     Apply directly over affected area, leave in place for 48 hours. Some products may be cut to fit area or secured with adhesive strips. May repeat procedure for up to 12 weeks. Apply to clean, dry skin",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     <b>",
"      Dandruff, psoriasis, or seborrheic dermatitis: Topical:",
"     </b>",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:4em;text-align:justify;\">",
"     <i>",
"      Cream (2.5%):",
"     </i>",
"     Apply to affected area 3-4 times daily. Apply to clean, dry skin. Some products may be left in place overnight.",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:4em;text-align:justify;\">",
"     <i>",
"      Foam:",
"     </i>",
"     Apply to affected area twice daily; rub into skin until completely absorbed.",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:4em;text-align:justify;\">",
"     <i>",
"      Ointment (3%):",
"     </i>",
"     Apply to scales or plaques on skin up to 4 times per day (not for scalp or face)",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:4em;text-align:justify;\">",
"     <i>",
"      Shampoo (1.8% to 3%):",
"     </i>",
"     Massage into wet hair or affected area; leave in place for several minutes; rinse thoroughly. Labeled for OTC use 2-3 times a week, or as directed by healthcare provider. Some products may be left in place overnight.",
"    </p>",
"   </div>",
"   <div class=\"block dop drugH1Div\" id=\"F219789\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Dosing: Pediatric",
"    </span>",
"    <p>",
"     (For additional information",
"     <a class=\"drug drug_pediatric\" href=\"UTD.htm?43/0/44038?source=see_link\">",
"      see \"Topical salicylic acid: Pediatric drug information\"",
"     </a>",
"     )",
"    </p>",
"    <p style=\"text-indent:0em;display:inline\">",
"     Children: Refer to adult dosing.",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Consult specific product labeling for use in children &lt;12 years.",
"    </p>",
"   </div>",
"   <div class=\"block doe drugH1Div\" id=\"F219776\" xmlns=\"file://www.w3.org/1999/xhtml\">",
