"   <div class=\"block geq drugH1Div\" id=\"F219750\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Generic Equivalent Available: U.S.",
"    </span>",
"    <p style=\"text-indent:0em;display:inline\">",
"     Yes: Foam, Bar, Cream, gel, lotion, shampoo, soap",
"    </p>",
"   </div>",
"   <div class=\"block use drugH1Div\" id=\"F219764\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Use",
"    </span>",
"    <p style=\"text-indent:0em;display:inline\">",
"     Topically for its keratolytic effect in controlling seborrheic dermatitis or psoriasis of body and scalp, dandruff, and other scaling dermatoses; also used to remove warts, corns, and calluses; acne",
"    </p>",
"   </div>",
"   <div class=\"block mst drugH1Div\" id=\"F219808\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Medication Safety Issues",
"    </span>",
"    <div class=\"collapsible\">",
"     <span class=\"collapsible-title\">",
"      Sound-alike/look-alike issues:",
"     </span>",
"     <div class=\"collapsible-wrap\">",
"      <p style=\"text-indent:-2em;margin-left:4em;\">",
"       Occlusal&trade;-HP may be confused with Ocuflox&reg;",
"      </p>",
"     </div>",
"    </div>",
"    <div class=\"collapsible\">",
"     <span class=\"collapsible-title\">",
"      Other safety concerns:",
"     </span>",
"     <div class=\"collapsible-wrap\">",
"      <p style=\"text-indent:-2em;margin-left:4em;\">",
"       Transdermal patch may contain conducting metal (eg, aluminum); remove patch prior to MRI.",
"      </p>",
"     </div>",
"    </div>",
"   </div>",
"   <div class=\"block ars drugH1Div\" id=\"F219801\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Adverse Reactions Significant",
"    </span>",
"    <p style=\"text-indent:0em;display:inline\">",
"     Frequency not defined.",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Central nervous system: Dizziness, headache, mental confusion",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Local: Burning and irritation at site of exposure on normal tissue, peeling, scaling",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Otic: Tinnitus",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Respiratory: Hyperventilation",
"    </p>",
"   </div>",
"   <div class=\"block coi drugH1Div\" id=\"F219767\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Contraindications",
"    </span>",
"    <p style=\"text-indent:0em;display:inline\">",
"     Hypersensitivity to salicylic acid or any component of the formulation",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;\">",
"     Additional contraindications: Virasal&reg;: Impaired circulation (eg, diabetes, peripheral vascular disease); moles, birthmarks; warts with hair growth or on face",
"    </p>",
"   </div>",
"   <div class=\"block war drugH1Div\" id=\"F219754\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Warnings/Precautions",
"    </span>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     <b>",
"      <i>",
"       Disease-related concerns:",
"      </i>",
"     </b>",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:4em;text-align:justify;\">",
"     &bull; Diabetes: Prior to OTC use, consult with healthcare provider if you have diabetes.",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:4em;text-align:justify;\">",
"     &bull; Poor circulation: Prior to OTC use, consult with healthcare provider if have poor circulation.",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     <b>",
"      <i>",
"       Other warnings/precautions:",
"      </i>",
"     </b>",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:4em;text-align:justify;\">",
"     &bull; Appropriate use: For external use only; not for application to areas that are irritated, infected, reddened, birthmarks, genital or facial warts, eyes or mucous membranes.",
"    </p>",
"   </div>",
"   <div class=\"block cyt drugH1Div\" id=\"F13300021\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Metabolism/Transport Effects",
"    </span>",
"    <p style=\"text-indent:0em;display:inline\">",
"     None known.",
"    </p>",
"   </div>",
"   <div class=\"block dri drugH1Div\" id=\"F219758\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Drug Interactions",
"    </span>",
"    <br/>",
"    <br/>",
"    <div class=\"lexi\" id=\"lexiInteractAddInfo\">",
"     (For additional information:",
"     <a class=\"dip\" href=\"./drug-interaction\" target=\"_blank\">",
"      Launch Lexi-Interact&trade; Drug Interactions Program",
"     </a>",
"     )",
"    </div>",
"    <div class=\"lexi\" id=\"lexiInteractImgB\">",
"     <img border=\"0\" height=\"17\" src=\"./../images/lexiComp/Lexicomp_2012_71x17.myextg\" width=\"71\"/>",
"    </div>",
"    <div class=\"clear\">",
"    </div>",
"    <p style=\"text-indent:0em;display:inline\">",
"     There are no known significant interactions.",
"    </p>",
"   </div>",
"   <div class=\"block prf drugH1Div\" id=\"F219759\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Pregnancy Risk Factor",
"    </span>",
"    <p style=\"text-indent:0em;display:inline\">",
"     C (",
"     <a class=\"graphic graphic_table\" href=\"UTD.htm?16/42/17068\">",
"      show table",
"     </a>",
"     )",
"    </p>",
"   </div>",
"   <div class=\"block pri drugH1Div\" id=\"F13386462\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Pregnancy Implications",
"    </span>",
"    <p style=\"text-indent:0em;display:inline\">",
"     Adverse events have been observed in animal reproduction studies when administered orally. Salicylates cross the placenta (Ostensen, 1998). Systemic absorption of topically applied salicylic acid varies depending on duration and vehicle (9% to 25%) (Akhavan, 2003).",
"    </p>",
"   </div>",
"   <div class=\"block brc drugH1Div\" id=\"F13386463\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Breast-Feeding Considerations",
"    </span>",
"    <p style=\"text-indent:0em;display:inline\">",
"     Oral salicylates are found in breast milk (Bar-Oz, 2003). Systemic absorption of topically applied salicylic acid varies depending on duration and vehicle (9% to 25%) (Akhavan, 2003) Breast-feeding is not recommended by the manufacturer.",
"    </p>",
"   </div>",
"   <div class=\"block fee drugH1Div\" id=\"F3422281\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Pricing: U.S. (Medi-Span&reg;)",
"    </span>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
