"   <div class=\"block pha drugH1Div\" id=\"F219753\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Mechanism of Action",
"    </span>",
"    <p style=\"text-indent:0em;display:inline\">",
"     Produces desquamation of hyperkeratotic epithelium via dissolution of the intercellular cement which causes the cornified tissue to swell, soften, macerate, and desquamate. Salicylic acid is keratolytic at concentrations of 3% to 6%; it becomes destructive to tissue at concentrations &gt;6%. Concentrations of 6% to 60% are used to remove corns and warts and in the treatment of psoriasis and other hyperkeratotic disorders.",
"    </p>",
"   </div>",
"   <div class=\"block phk drugH1Div\" id=\"F219766\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Pharmacodynamics/Kinetics",
"    </span>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Absorption: Percutaneous; systemic toxicity unlikely with normal use",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Time to peak, serum: Within 5 hours of application with occlusion",
"    </p>",
"   </div>",
"  </div>",
