" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 529px\">",
"   <div class=\"ttl\">",
"    Histology of enteropathy-associated T-cell lymphoma type 2",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 509px; height: 509px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
